class Example:
MARKERS = {"[", "]"}
def __init__(self, filler):
self._filler = filler
def revise(self, contents):
end = None
for (i, val) in enumerate(contents):
if self.spans(val):
if (end is None) or (i > end):
end = i
return end
def spans(self, value):
return self._filler(value) in self.MARKERS
